import * as React from 'react';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import useMediaQuery from '@mui/material/useMediaQuery';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Navigator from './Navigator';
import Content from './Content';
import Typography from '@mui/material/Typography';
import { useState } from 'react';

//import { useLocation } from 'react-router-dom';

let theme = createTheme({
  palette: {
    primary: {
      light: '#63ccff',
      main: '#009be5',
      dark: '#006db3',
    },
  },
});

export default function Paperbase({ data}) {

  
  const [mobileOpen, setMobileOpen] = React.useState(false);
  const isSmUp = useMediaQuery(theme.breakpoints.up('sm'));
  const [dato] = useState("NOOO");
  console.log('Data recibida en Delete:', data);
  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  
  
  
  console.log('Carlos Alverti coko estar');

  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ display: 'flex' }}>
        
        <Box sx={{ flex: 1, display: 'flex', flexDirection: 'column' }}>
          <Box sx={{ py: 2, px: 4, bgcolor: '#FCFCFC', color: '#030303', textAlign: 'center' }}>
            <Typography variant="h3" component="div" sx={{ fontWeight: 'bold', letterSpacing: 1.5 }}>
              Photos Googl
            </Typography>
          </Box>
          <Box component="main" sx={{ flex: 1, py: 6, px: 4, bgcolor: '#FCFCFC' }}>
          <Content dato={dato}/>
          </Box>
        </Box>
      
      </Box>
    </ThemeProvider>
  );
}
